import './App.css';
import * as React from 'react';
import Header from "./pages/include/header.js";
import Footer from "./pages/include/footer.js";
import RightMenu from "./pages/include/right_menu.js";
import { render } from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import CntTest from "./pages/cnttest.js";
import CntTest2 from "./pages/cnttest2.js";



const App = () => {
    const rootElement = document.getElementById("root");
  render(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="expenses" element={<Expenses />} />
        <Route path="invoices" element={<Invoices />} />
      </Routes>
    </BrowserRouter>,
    rootElement
  );

  return (

    <div className="App">
      <Header />
      <div className="banner-sec">
          <div className="banner-tit">타이틀입니다.</div>
      </div>
      <div className="wrap">
          <body className="app-body">
            <CntTest />
            <RightMenu />
          </body>
      </div>


      <Footer />

    </div>
  );
};

export default App;
